import { TemperatureLegendWrapper, ColorScale } from "./legend_wind_style";

function WindLegend() {
  return (
    <TemperatureLegendWrapper>
      <h3>Ship Type</h3>
      <ColorScale />
    </TemperatureLegendWrapper>
  );
}

export default WindLegend;
